static int pack_can_0x40000000_VECTOR__INDEPENDENT_SIG_MSG(can_obj_can1_h_t *o, uint64_t *data) {
	assert(o);
	assert(data);
	register uint64_t x;
	register uint64_t i = 0;
	/* Status: start-bit 8, length 8, endianess intel, scaling 1, offset 0 */
	x = ((uint8_t)(o->can_0x40000000_VECTOR__INDEPENDENT_SIG_MSG.Status)) & 0xff;
	x <<= 8; 
	i |= x;
	*data = (i);
	o->can_0x40000000_VECTOR__INDEPENDENT_SIG_MSG_tx = 1;
	return 1;
}

static int unpack_can_0x40000000_VECTOR__INDEPENDENT_SIG_MSG(can_obj_can1_h_t *o, uint64_t data, uint8_t dlc, dbcc_time_stamp_t time_stamp) {
	assert(o);
	assert(dlc <= 8);
	register uint64_t x;
	register uint64_t i = (data);
	if (dlc < 1)
		return -1;
	/* Status: start-bit 8, length 8, endianess intel, scaling 1, offset 0 */
	x = (i >> 8) & 0xff;
	o->can_0x40000000_VECTOR__INDEPENDENT_SIG_MSG.Status = x;
	o->can_0x40000000_VECTOR__INDEPENDENT_SIG_MSG_rx = 1;
	o->can_0x40000000_VECTOR__INDEPENDENT_SIG_MSG_time_stamp_rx = time_stamp;
	return 1;
}

