int unpack_message_can1(can_obj_can1_h_t *o, const unsigned long id, uint64_t data, uint8_t dlc, dbcc_time_stamp_t time_stamp) {
	assert(o);
	assert(id < (1ul << 29)); /* 29-bit CAN ID is largest possible */
	assert(dlc <= 8);         /* Maximum of 8 bytes in a CAN packet */
	switch (id) {
	case 0x184: return unpack_can_0x184_VCUInvFL(o, data, dlc, time_stamp);
	case 0x185: return unpack_can_0x185_VCUInvFR(o, data, dlc, time_stamp);
	case 0x188: return unpack_can_0x188_VCUInvRL(o, data, dlc, time_stamp);
	case 0x189: return unpack_can_0x189_VCUInvRR(o, data, dlc, time_stamp);
	case 0x283: return unpack_can_0x283_InverterFL1(o, data, dlc, time_stamp);
	case 0x284: return unpack_can_0x284_InverterFR1(o, data, dlc, time_stamp);
	case 0x285: return unpack_can_0x285_InverterFL2(o, data, dlc, time_stamp);
	case 0x286: return unpack_can_0x286_InverterFR2(o, data, dlc, time_stamp);
	case 0x287: return unpack_can_0x287_InverterRL1(o, data, dlc, time_stamp);
	case 0x288: return unpack_can_0x288_InverterRR1(o, data, dlc, time_stamp);
	case 0x289: return unpack_can_0x289_InverterRL2(o, data, dlc, time_stamp);
	case 0x28a: return unpack_can_0x28a_InverterRR2(o, data, dlc, time_stamp);
	case 0x40000000: return unpack_can_0x40000000_VECTOR__INDEPENDENT_SIG_MSG(o, data, dlc, time_stamp);
	default: break; 
	}
	return -1; 
}

